import React from 'react'
import Card from './Card'
import './Exhibit.css'

function Exhibit() {
  return (
    <div id="card-container">
      <Card title="IPV4 Address" info="{ip: '128.91.56.204'}"/>
      <Card title="IPV6 Address" info="{ip: '2607:f470:34:2301:6875:2938:c9ef:9e37'}"/>
    </div>
  )
}

export default Exhibit
